import React from "react";
import classes from "./dropDownMenu.module.scss";

const DropDownMenu = ({ dropDown, data }) => {
  const rootClasses = [classes.dropDown];
  if (dropDown) {
    rootClasses.push(classes.active);
  }

  const content = () => {
    data.filter((item) => item === data[0]);
    console.log(content)
  };

  return (
    <div className={rootClasses.join(" ")}>
      <h4>{Object.keys(content[0])}</h4>
      <ul>
        <li>dddd</li>
      </ul>
    </div>
  );
};

export default DropDownMenu;
